import React from 'react';
import '../css/Home';

class Home extends React.Component{
  renderPanels(title){
    return(
      <div className="olive column">
        {title}
      </div>
    );
  }

  render(){
    return(
      <div className="ui stackable three column centered grid">
        <div class="six column centered row">
          {this.renderPanels('hello')}
          {this.renderPanels('hello')}
          {this.renderPanels('hello')}
        </div>
      </div>
    );
  };
}

export default Home;
